import { useState } from 'react';
import './App.css';
import Banner from './pages/Banner';
import Header from './pages/Header';

function App() {
  const [movies, setMovies] = useState([]);

  const fetchMovies = () => {
    const movieListFetch = fetch('http://www.omdbapi.com/?i=tt3896198&apikey=a8fe4d3e')
    .then(res => res.json)
    .then(data => console.log(data))
  }

  fetchMovies();
  return (
    <div>
      <header>
        <Header />
      </header>
      <Banner />
    </div>
  );
}

export default App;
